  false,\n\t\"url\": null,\n\t\"notes\": \"This GIS data layer represents point coverage
  of seafloor sediment size and composition in Massachusetts territorial waters. The
  data were created by aggregating available sediment point data collected from the
  United States Geological Survey's (USGS) usSEABED, version 1.0, U.S. Geological
  Survey Data Series 118 (Reid 2005), the Massachusetts Water Resources Authority,
  the Massachusetts Division of Marine Fisheries, and the United States Environmental
  Protection Agency. Sediment data were collected between 1884 to 2008 from a variety
  of published and unpublished sediment texture and other geologic data. As such,
  the data has a variety of different horizontal accuracies and sampling and analysis
  methodologies. The dataset includes relative data quality for each point. More information
  regarding the compiled data sources and data quality assessment is available in
  Ford, K.H. and S.E. Voss. 2010. Seafloor sediment composition in Massachusetts determined
  using point data. Massachusetts Division of Marine Fisheries Technical Report, TR-45.
  21pp.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\": \"bbox-east-long\",\n\t\t\"value\":
